🏆 Steven a été l'homme canadien le plus décoré en patinage de vitesse courte piste la saison dernière, lui qui a raflé quatre médailles individuelles de la Coupe du monde, remportant notamment sa première médaille d'or en carrière lors du 500m disputé à Dresde. L'athlète de 23 ans a aussi été la pierre d'assise du relais masculin canadien quand celui-ci a décroché l'or àDordrecht et le bronze à Salt Lake City. Il a par ailleurs récolté trois médailles d'argent en route vers la deuxième place au classement général à l'occasionde la présentation inaugurale des Championnats des Quatre continents à Montréal. Après avoir dominé les Championnats canadiens de courte piste 2019 – il a alors mis la main sur les six médailles d'or à l'enjeu –, il a complété la saison internationale écourtée classé au 11e rang, ayant réussi à signer des résultats top-10 dans chacune des trois distances.
.
Steven en est à son premier prix Marc Gagnon remis à l'Athlète masculin de l'année au Canada en courte piste. L'honneur était revenu à Samuel Girard, récemment parti à la retraite, lors des trois années précédentes, tandis que le vétéran de l'équipe nationale Charles Hamelin l'a emporté un nombre record de 10 fois de 2005 à 2016.
